import { Info } from '@material-ui/icons';
import React from 'react';
import styled from "styled-components";


const Container = styled.div`
display:flex;
padding:20px;
b

`;

const CategoryItem = ({item}) => {
  return (
    <Container>
        <Image/>
        <Info/>
        <Title>{item.title}</Title>
        <Button></Button>
    </Container>
  )
}

export default CategoryItem
